import React, { Component } from 'react';
import ""

export default class TNode extends Component {
    constructor(row, col, isStart, isFinish) {
        super();
        this.setState = {
            row: row,
            col: col,
            isStart: isStart,
            isFinish: isFinish,
            isVisited: false,
        };
    }

    render() { 
        return "";
    }
}
